from sympy import factorint
def aupto(limit):
    alst, i, k, s, p = [], 1, 0, 0, 1
    while k < limit:
        if sum(factorint(i).values()) == 2:
            k += 1; s += i; p *= i
            if p%s == 0: alst.append(k)
        i += 1
    return alst
